/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div	class="ui5-mp-root"	role="grid"	aria-readonly="false"	aria-multiselectable="false"	style="${styleMap(context.styles.main)}"	@keydown=${context._onkeydown}	@click=${context._onclick}>	${ repeat(context._quarters, (item, index) => item._id || index, (item, index) => block1(item, index, context)) }</div>`; };
const block1 = (item, index, context) => { return html`<div class="ui5-mp-quarter">			${ repeat(item, (item, index) => item._id || index, (item, index) => block2(item, index, context)) }</div>	`; };
const block2 = (item, index, context) => { return html`<div					id="${ifDefined(item.id)}"					data-sap-timestamp=${ifDefined(item.timestamp)}					tabindex=${ifDefined(item._tabIndex)}					class="${ifDefined(item.classes)}"					role="gridcell"					aria-selected="false"				>					${ifDefined(item.name)}</div>			`; };

export default block0;
